import { useEffect, useState } from "react";

const Home = () => {
  const API_URL = "https://fakestoreapi.com/products";
  const [loading,setLoading]=useState(false);
  const [post,setPost]=useState([]);

  const fetchProductData=async=()=>{
    setLoading(true);
    fetch(API_URL)
    .then(res=>res.json())
    .then(data=>{
      setPost(data)
    })

    .catch(error=>{
      console.log("Error...")
      setPost([]);
    })

    setLoading(false);
  }

  useEffect()
  return (
    <div>

    </div>
  )
};

export default Home;
